import React, { Fragment } from 'react';

const Index = () => (
  <Fragment>
    <div id="content">
      <div className="left_content">content</div>
      <div className="right_content">profile</div>
    </div>
    <style jsx>
      {`
        #content{
          overflow:hidden;
        }
        .left_content{
          float:left;
          width:63%;
          background-color:blue;
          margin: 1%;
        }
        .right_content{
          float:left;
          width:33%;  
          margin: 1%;
          background-color:blue;
        }
      `}
    </style>
  </Fragment>
);

export default Index;
